import React, { useState, useEffect } from 'react'
import axios from 'axios'
function DataFetingPhoto() {
  const [common, setCommon] = useState({})
  const [id, setId] = useState(21)

  useEffect(() => {
    axios
      .get(`http://localhost:3333/data/${id}`)
      .then(res => {
        setCommon(res.data)
      })
      .catch(err => {
        console.log(err)
      })
  }, [])
  console.log(common)
  return (
    <div>
      <input type value={id} onChange={e => setId(e.target.value)} />
      {/* <p>
        {commons.common.invited_people.name &&
          commons.common.invited_people.name}
      </p> */}
      <ul>
        {common.map(common => (
          <li key={common.id} id={common.id}>
            {common.invited_people && common.invited_people.username}
          </li>
        ))}
      </ul>
    </div>
  )
}

export default DataFetingPhoto
